%    This function was generated by the Symbolic Math Toolbox version 8.4.
%    20-Apr-2020 23:37:38

t2 = cos(th1);
t3 = sin(th1);
t4 = th1+th2;
t5 = l1.*t2;
t6 = l1.*t3;

% q_sp1 = [t5;t6;0.0;1.0];
% if nargout > 1
%     q_sp2 = [t5+l2.*cos(t4);t6+l2.*sin(t4);0.0;1.0];
