num = length(th1);
Zero = zeros(num,1);
One = ones(num,1);

q_sp1 = [t5 t6 Zero One];
if nargout > 1
    q_sp2 = [t5+l2.*cos(t4) t6+l2.*sin(t4) Zero One];
end